import tkinter as tk
from tkinter import filedialog
import base64
import tempfile
from request import Backup
import json
from tools import open_folder_in_explorer, find_documents_folder


icon_data = ""

with tempfile.NamedTemporaryFile(delete=False, suffix='.ico') as temp:
    temp.write(base64.b64decode(icon_data))
    temp_filename = temp.name


def backup_request(url, name, master_pwd, fileformat, delete_older_than, output_folder, config_file):
    if config_file:
        with open(config_file, "r") as f:
            config = json.load(f)
            for db in config:
                url = db.get("url")
                name = db.get("name")
                master_pwd = db.get("master_pwd")
                fileformat = db.get("fileformat")
                output_folder = db.get("output_folder")
                delete_older_than = int(db.get("delete_older_than"))
                try:
                    result = Backup.backup(url, master_pwd, name, fileformat, output_folder)
                except Exception as e:
                    return False, e
                if result and delete_older_than:
                    Backup.delete_older_than(delete_older_than, output_folder)
        open_folder_in_explorer(output_folder)
        return True, None
    else:
        try:
            result = Backup.backup(url, master_pwd, name, fileformat, output_folder)
        except Exception as e:
            return False, e
        if result and delete_older_than:
            Backup.delete_older_than(delete_older_than, output_folder)
        open_folder_in_explorer(output_folder)
        return True, None


def execute_backup():
    if use_config_var.get():
        config_file = config_file_entry.get()
        result, message = backup_request(None, None, None, None, None, None, config_file)
    else:
        url = url_entry.get()
        name = name_entry.get()
        master_pwd = master_pwd_entry.get()
        file_format = file_format_var.get()
        delete_older_than = int(delete_older_than_entry.get())
        output_folder = output_folder_entry.get()
        result, message = backup_request(url, name, master_pwd, file_format, delete_older_than, output_folder, None)

    if result:
        result_label.config(text="Backup successful!", fg="green")
    else:
        result_label.config(text="Backup failed! " + message[:10], fg="red")


def select_output_folder():
    folder = filedialog.askdirectory()
    if folder:
        output_folder_entry.delete(0, tk.END)
        output_folder_entry.insert(0, folder)


def select_config_file():
    file = filedialog.askopenfilename(filetypes=[("JSON Files", "*.json")])
    if file:
        config_file_entry.delete(0, tk.END)
        config_file_entry.insert(0, file)


def toggle_config():
    if use_config_var.get():
        for elem in input_widgets:
            elem.grid_remove()
        for elem in config_widgets:
            elem.grid()
    else:
        for elem in input_widgets:
            elem.grid()
        for elem in config_widgets:
            elem.grid_remove()


app = tk.Tk()
app.title("ODOO Backup Wizard v1.0")

url_label = tk.Label(app, text="URL:", width=15, anchor="e")
url_entry = tk.Entry(app, width=50)
name_label = tk.Label(app, text="Database Name:", width=15, anchor="e")
name_entry = tk.Entry(app, width=50)
master_pwd_label = tk.Label(app, text="Master Password:", width=15, anchor="e")
master_pwd_entry = tk.Entry(app, width=50, show="*")
file_format_label = tk.Label(app, text="File Format:", width=15, anchor="e")
file_format_var = tk.StringVar()
file_format_var.set("zip")
file_format_entry = tk.OptionMenu(app, file_format_var, "zip", "dump")
delete_older_than_label = tk.Label(app, text="Delete Older (days):", width=15, anchor="e")
delete_older_than_entry = tk.Entry(app, width=50)
output_folder_label = tk.Label(app, text="Output Folder:", width=15, anchor="e")
output_folder_entry = tk.Entry(app, width=50)
output_folder_entry.insert(0, find_documents_folder())
output_folder_button = tk.Button(app, text="Browse", command=select_output_folder)
config_file_label = tk.Label(app, text="Config File:", width=15, anchor="e")
config_file_entry = tk.Entry(app, width=50)
config_file_entry.insert(0, "config.json")
config_file_button = tk.Button(app, text="Browse", command=select_config_file)

# Checkbox
use_config_var = tk.IntVar()
use_config_check = tk.Checkbutton(app, text="Use Config File", variable=use_config_var, command=toggle_config, anchor="w")

# Execute button
execute_button = tk.Button(app, text="Execute Backup", command=execute_backup)

# Result label
result_label = tk.Label(app, text="")

# Layout
use_config_check.grid(row=0, column=1, sticky="w")
url_label.grid(row=1, column=0)
url_entry.grid(row=1, column=1)
name_label.grid(row=2, column=0)
name_entry.grid(row=2, column=1)
master_pwd_label.grid(row=3, column=0)
master_pwd_entry.grid(row=3, column=1)
file_format_label.grid(row=4, column=0)
file_format_entry.grid(row=4, column=1, sticky="w")
delete_older_than_label.grid(row=5, column=0)
delete_older_than_entry.grid(row=5, column=1)
output_folder_label.grid(row=6, column=0)
output_folder_entry.grid(row=6, column=1)
output_folder_button.grid(row=6, column=2, padx=5)
config_file_label.grid(row=7, column=0)
config_file_entry.grid(row=7, column=1)
config_file_button.grid(row=7, column=2, padx=5)
execute_button.grid(row=8, column=1, pady=5)
result_label.grid(row=9, column=1)

input_widgets = [
    url_label, url_entry, name_label, name_entry, master_pwd_label, master_pwd_entry,
    delete_older_than_label, delete_older_than_entry, output_folder_label, output_folder_entry,
    output_folder_button, file_format_label, file_format_entry
]

config_widgets = [config_file_label, config_file_entry, config_file_button]

for widget in input_widgets:
    widget.grid()
for widget in config_widgets:
    widget.grid_remove()

app.resizable(False, False)
app.iconbitmap(temp_filename)
app.mainloop()
